import { NavLink } from "react-router-dom";

const LazyLayout = () => {
  return (
    <div>
      <h1>LazyLayout Page</h1>

      <ul>
        <li>
          <NavLink to="lazy1">Lazy 1</NavLink>
        </li>
      </ul>
    </div>
  );
};

export default LazyLayout;
